import React, { useState, useEffect } from 'react'; // Import React and necessary hooks
import axios from 'axios'; // Import Axios for making HTTP requests
import { useNavigate } from 'react-router-dom'; // Import useNavigate hook for navigation

// Define Index component
const Index = () => {
  const [startRange, setStartRange] = useState(0); // State for start range input
  const [endRange, setEndRange] = useState(0); // State for end range input
  const [primeResults, setPrimeResults] = useState(null); // State for storing prime number results
  const [selectedAlgorithm, setSelectedAlgorithm] = useState('Sieve of Eratosthenes'); // Default algorithm selected
  const [errorMessage, setErrorMessage] = useState(''); // State for error messages
  const navigate = useNavigate(); // Initialize navigation hook

  // Handle submit button click
  const fetchPrimeNumbers = async () => {
    try {
      const response = await axios.post('http://localhost:3001/api/data', {
        start: startRange,
        end: endRange,
        algorithm: selectedAlgorithm,
      });

      setPrimeResults(response.data); // Set response data as prime results
    } catch (error) {
      setErrorMessage('An error occurred while fetching prime numbers');
    }
  };

  // Handle form submission
  const handleSubmit = async (event) => {
    event.preventDefault();
    fetchPrimeNumbers();
  };

  return (
    <div>
      <h1>Prime Number Generator</h1>

      {/* Form to input start and end range and select algorithm */}
      <form onSubmit={handleSubmit}>
        <div>
          <label>Start Range:</label>
          <input
            type="number"
            value={startRange}
            onChange={(e) => setStartRange(Number(e.target.value))}
            required
          />
        </div>
        <div>
          <label>End Range:</label>
          <input
            type="number"
            value={endRange}
            onChange={(e) => setEndRange(Number(e.target.value))}
            required
          />
        </div>
        <div>
          <label>Select Algorithm:</label>
          <select
            value={selectedAlgorithm}
            onChange={(e) => setSelectedAlgorithm(e.target.value)}
          >
            <option value="Sieve of Eratosthenes">Sieve of Eratosthenes</option>
            <option value="Trial Division">Trial Division</option>
            <option value="Sieve of Sundaram">Sieve of Sundaram</option>
            <option value="Sieve of Atkin">Sieve of Atkin</option>
            <option value="Miller-Rabin Primality Test">Miller-Rabin Primality Test</option>
            <option value="Lucas-Lehmer Primality Test">Lucas-Lehmer Primality Test</option>
            <option value="AKS Primality Test">AKS Primality Test</option>
          </select>
        </div>
        <button type="submit">Generate Primes</button>
      </form>

      {/* Display error message */}
      {errorMessage && <p>{errorMessage}</p>}

      {/* Display prime numbers */}
      {primeResults && (
        <div>
          <h3>Prime Numbers:</h3>
          <p>Algorithm: {primeResults.algorithm}</p>
          <p>Prime Numbers: {primeResults.primes.join(', ')}</p>
          <p>Total Primes: {primeResults.numPrimes}</p>
        </div>
      )}
    </div>
  );
};

export default Index;
